import React from 'react';
import { useNavigate } from "react-router-dom";

function Category() {
  let navigate = useNavigate();
  return (
    <>
    <h1>Congratulations</h1>
    <button onClick={() => {navigate("/")}} >Back to Home</button>
    </>
  )
}

export default Category;
